(function(){var loadHandler=window['sl_{935E51C0-57EC-4499-805F-ACBD9CD11F21}'];loadHandler&&loadHandler(14, '<div id="spr0_1d54b1d4"><div id="spr1_1d54b1d4" class="kern slide"><img id="img2_1d54b1d4" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/></div><div id="spr2_1d54b1d4" class="kern slide"><div id="spr3_1d54b1d4" aria-label="Почему солнце горячее? | Политехнический музей" role="group" style="left:-779.49px;top:1107.289px;"><div id="spr4_1d54b1d4"><img id="img0_1d54b1d4" src="data:image/jpeg;base64," width="1912.572" height="1434.43" alt=""/></div></div><div id="svg14_1d54b1d4" style="left:-93.638px;top:1.663px;"><svg width="1316" height="331" viewBox="-41.34 -41.34 1316 331"><path fill="#222358" d="M0,41.34 a41.34,41.34 0 0,1 41.34,-41.34 h1149.754 a41.34,41.34 0 0,1 41.34,41.34 v165.355 a41.34,41.34 0 0,1 -41.34,41.34 h-1149.754 a41.34,41.34 0 0,1 -41.34,-41.34 Z" fill-rule="evenodd"/></svg></div><div id="spr5_1d54b1d4" style="left:62.047px;top:76.415px;"><div style="width:0px;"><span id="txt0_1d54b1d4" data-width="691.859375" style="left:9.6px;top:1.423px;">Какая самая большая звезда во Вселенной?</span></div></div><div id="spr6_1d54b1d4" style="left:62.047px;top:140.512px;"><div style="width:0px;"><span id="txt1_1d54b1d4" data-width="1046.601563" style="left:9.6px;top:2.267px;">По оценкам ученых, Вселенная содержит более 100 миллиардов галактик, каждая из которых,</span></div><div style="width:0px;"><span id="txt2_1d54b1d4" data-width="1016.050781" style="left:9.6px;top:31.067px;">в свою очередь, содержит от нескольких миллионов до сотен миллиардов звезд. Нетрудно</span></div><div style="width:0px;"><span id="txt3_1d54b1d4" data-width="1034.953125" style="left:9.6px;top:59.867px;">догадаться, что в них могут существовать такие гиганты, о которых мы даже не подозреваем.</span></div><div style="width:0px;"><span id="txt4_1d54b1d4" data-width="945.410156" style="left:9.6px;top:88.667px;">Поэтому вопрос, какая звезда самая большая, неоднозначен даже для самих ученых.</span></div></div><div id="spr7_1d54b1d4" aria-label="Почему солнце горячее? | Политехнический музей" role="group" style="left:831.909px;top:415.467px;"><div id="spr8_1d54b1d4"><img id="img1_1d54b1d4" src="data:image/png;base64," width="47.528" height="35.646" alt=""/></div></div><div id="spr9_1d54b1d4" style="left:276.396px;top:342.955px;"><div style="width:0px;"><span id="txt5_1d54b1d4" data-width="265.101563" style="left:9.6px;top:2.267px;">Звезда VY в созвездии</span></div><div style="width:0px;"><span id="txt6_1d54b1d4" data-width="167.261719" style="left:9.6px;top:31.067px;">Большого Пса</span></div><div style="width:0px;"><span id="txt7_1d54b1d4" data-width="225.507813" style="left:9.6px;top:60.711px;">Одна из самых больших звезд,</span></div><div style="width:0px;"><span id="txt8_1d54b1d4" data-width="221.164063" style="left:9.6px;top:79.911px;">известных на данный момент.</span></div><div style="width:0px;"><span id="txt9_1d54b1d4" data-width="285.507813" style="left:9.6px;top:99.111px;">Ее радиус — от 1300 до 1540 радиусов</span></div><div style="width:0px;"><span id="txt10_1d54b1d4" data-width="242.789063" style="left:9.6px;top:118.311px;">Солнца, а диаметр — около двух</span></div><div style="width:0px;"><span id="txt11_1d54b1d4" data-width="183.695313" style="left:9.6px;top:137.511px;">миллиардов километров</span></div></div><div id="spr10_1d54b1d4" style="left:961.314px;top:479.194px;"><div style="width:0px;"><span id="txt12_1d54b1d4" data-width="87.421875" style="left:9.6px;top:2.267px;">Солнце</span></div><div style="width:0px;"><span id="txt13_1d54b1d4" data-width="246.226563" style="left:9.6px;top:39.534px;">Диаметр Солнца — 1,392 млн км.</span></div><div style="width:0px;"><span id="txt14_1d54b1d4" data-width="233.046875" style="left:9.6px;top:59.111px;">Если представить наше светило</span></div><div style="width:0px;"><span id="txt15_1d54b1d4" data-width="196.718750" style="left:9.6px;top:78.311px;">как шар в один сантиметр,</span></div><div style="width:0px;"><span id="txt16_1d54b1d4" data-width="234.406250" style="left:9.6px;top:97.511px;">то диаметр VY составит 21 метр</span></div></div><div id="svg10_1d54b1d4" style="left:858.653px;top:497.466px;"><svg width="41" height="103" viewBox="-1 -1 41 103"><g fill="none"><g transform="translate(0.333333,0.333333)"><path stroke="#ffffff" stroke-width="0.8" stroke-linecap="butt" stroke-linejoin="miter" stroke-miterlimit="8" d="M37.878,0 H0 V100.227"/></g></g></svg></div><div id="svg16_1d54b1d4" style="left:30.824px;top:573.941px;"><svg width="302" height="120" viewBox="-30.557 -30.557 302 120"><a xlink:href="#" onclick="document.getElementById(\'coreSpr_5538767\').getCore().processTriggerEffect(this);document.getElementById(\'coreSpr_5538767\').getCore().gotoNextSlide(this);return false;" fill="none"><path fill="#ffffff" stroke="#000000" stroke-width="1.333" stroke-linecap="butt" stroke-linejoin="miter" stroke-miterlimit="8" d="M0.667,29.224 a28.557,28.557 0 0,1 28.557,-28.557 h181.671 a28.557,28.557 0 0,1 28.557,28.557 v0 a28.557,28.557 0 0,1 -28.557,28.557 h-181.671 a28.557,28.557 0 0,1 -28.557,-28.557 Z" fill-rule="evenodd"/></a></svg></div><div id="spr11_1d54b1d4" style="left:61.381px;top:604.498px;"><div style="width:0px;"><a id="hl0_1d54b1d4" href="#" onclick="document.getElementById(\'coreSpr_5538767\').getCore().processTriggerEffect(this);document.getElementById(\'coreSpr_5538767\').getCore().gotoNextSlide(this);return false;"><span id="txt17_1d54b1d4" data-width="123.468750" style="left:63.489px;top:14.172px;">Продолжить</span></a></div></div><div id="svg17_1d54b1d4" style="left:120.333px;top:362.833px;"><svg width="150" height="2" viewBox="-0.667 -0.333 150 2"><g fill="#ffffff" stroke="none"><path stroke="#ffffff" stroke-width="0.8" stroke-linecap="butt" transform="translate(-121,-363.166687)" d="M269.5,363.5 H121"/></g></svg></div></div></div>');})();